import React, {useState} from 'react'
import {NavLink, Navigate} from 'react-router-dom'
import {Button, Form, Grid, Icon, Segment, Menu, Message, Divider} from 'semantic-ui-react'
import {useAuth} from '../context/AuthContext'
import {estateApi} from '../misc/EstateApi'
import {parseJwt, handleLogError,getSocialLoginUrl} from '../misc/Helpers'
import Footer from "../Footer";

function Signup() {
    const Auth = useAuth()
    const isLoggedIn = Auth.userIsAuthenticated()

    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
    const [name, setName] = useState('')
    const [email, setEmail] = useState('')
    const [isError, setIsError] = useState(false)
    const [errorMessage, setErrorMessage] = useState('')

    const handleInputChange = (e, {name, value}) => {
        if (name === 'username') {
            setUsername(value)
        } else if (name === 'password') {
            setPassword(value)
        } else if (name === 'name') {
            setName(value)
        } else if (name === 'email') {
            setEmail(value)
        }
    }

    const handleSubmit = async (e) => {
        e.preventDefault()

        if (!(username && password && name && email)) {
            setIsError(true)
            setErrorMessage('Please, inform all fields!')
            return
        }

        const user = {username, password, name, email}

        try {
            const response = await estateApi.signup(user)
            const {accessToken} = response.data
            const data = parseJwt(accessToken)
            const authenticatedUser = {data, accessToken}

            Auth.userLogin(authenticatedUser)

            setUsername('')
            setPassword('')
            setIsError(false)
            setErrorMessage('')
        } catch (error) {
            handleLogError(error)
            if (error.response && error.response.data) {
                const errorData = error.response.data
                let errorMessage = 'Invalid fields'
                if (errorData.status === 409) {
                    errorMessage = errorData.message
                } else if (errorData.status === 400) {
                    errorMessage = errorData.errors[0].defaultMessage
                }
                setIsError(true)
                setErrorMessage(errorMessage)
            }
        }
    }

    if (isLoggedIn) {
        return <Navigate to='/'/>
    }

    return (
        <div>
            <Grid textAlign='center'>
                <Grid.Column style={{maxWidth: 450}}>
                    <Form size='large' onSubmit={handleSubmit}>
                        <Segment>
                            <Form.Input
                                fluid
                                autoFocus
                                name='username'
                                icon='user'
                                iconPosition='left'
                                placeholder='Username'
                                onChange={handleInputChange}
                            />
                            <Form.Input
                                fluid
                                name='password'
                                icon='lock'
                                iconPosition='left'
                                placeholder='Password'
                                type='password'
                                onChange={handleInputChange}
                            />
                            <Form.Input
                                fluid
                                name='name'
                                icon='address card'
                                iconPosition='left'
                                placeholder='Name'
                                onChange={handleInputChange}
                            />
                            <Form.Input
                                fluid
                                name='email'
                                icon='at'
                                iconPosition='left'
                                placeholder='Email'
                                onChange={handleInputChange}
                            />
                            <Button color='grey' fluid size='large'>Signup</Button>
                        </Segment>
                    </Form>
                    <Message>{`Already have an account? `}
                        <NavLink to="/login" color='grey'>Login</NavLink>
                    </Message>
                    {isError && <Message negative>{errorMessage}</Message>}

                    <Divider horizontal>or connect with</Divider>

                    <Menu compact icon='labeled'>
                    <Menu.Item name='github' href={getSocialLoginUrl('github')}>
                        <Icon name='github' />Github
                    </Menu.Item>
                    <Menu.Item name='google' href={getSocialLoginUrl('google')}>
                        <Icon name='google' />Google
                    </Menu.Item>
                    </Menu>
                </Grid.Column>
            </Grid>
            <Footer/>
        </div>
    )
}

export default Signup
